import { TrafficControl,YMaps, Map,GeolocationControl,FullscreenControl,RouteButton,ZoomControl,Placemark,SearchControl, TypeSelector} from 'react-yandex-maps';

const App = () => (
<YMaps 

  enterprise
  query={{
    lang:'en_RU',
    apikey:'d9f8ee44-f383-4f70-9645-c21e180947ea',
    
  }}
  
  options={{width:'100%'}}
>
  <Map
    width='100%'

    defaultState={{
      center: [40.993599, 71.677452],
      zoom: 9,
      controls: [],
    }}
  >
    <Placemark geometry={[40.993599, 71.677452]} />
    <GeolocationControl options={{ float: 'left' }} />
    <FullscreenControl />
    <SearchControl da />
    <TrafficControl options={{ float: 'right'}} />
    <RouteButton options={{float:'left',bottom:'0'}} />
    <ZoomControl options={{ float: 'right' }} />
    <TypeSelector options={{ float: 'right' }}  />

  </Map>
</YMaps>
);
export default App;
